import React from "react";
import Style from "./registrationForm.module.scss";
import {
  ColFields,
  ImageSelector,
  TextArea,
  Buttons,
  Title,
  FormFields,
} from "../../formFields";
import axios from "axios";

export default function RegistrationForm() {
  function handleSubmit(e) {
    e.preventDefault();
    const name = e.target.elements.NomeVeiculo.value;
    const fabricante = e.target.elements.Fabricante.value;
    const modelo = e.target.elements.Modelo.value;
    const ano = e.target.elements.Ano.value;
    const cambio = e.target.elements.Cambio.value;
    console.log(typeof name);


    const data = {
      name,
      fabricante,
      modelo,
      ano,
      cambio
      // Potencia: e.target.Potência.value,
      // Torque: e.target.Torque.value,
      // KM: e.target.KM.value,
      // Cor: e.target.Cor.value,
      // Cabine: e.target.Cabine.value,
      // RelacaoDiferencial: e.target.RelacaoDiferencial.value,
      // Suspensao: e.target.Suspensão.value,
      // EntreEixos: e.target.EntreEixos.value,
      // Placa: e.target.Placa.value,
      // CapMaxCombustivel: e.target.CapMaxCombustível.value,
      // Preco: e.target.Preço.value,
      // InfoAd: e.target.InfoAd.value,
      // InfoOp: e.target.InfoOp.value,
    };

    axios
      .post("https://localhost:4000/veiculo", data)
      .then((res) => {
        console.log(res.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }
  return (
    <>
      <div className={Style.container}>
        <div className={Style.form__container}>
          <label className={Style.form__title__field}>
            <Title title={"Cadastro de veículos"} Style={Style} />
            <form className={Style.form__field} onSubmit={handleSubmit}>
              <div className={Style.form}>
                <FormFields
                  type={"text"}
                  name={"NomeVeiculo"}
                  placeholder={"Nome do Veiculo"}
                />
                <FormFields
                  name={"Fabricante"}
                  placeholder={"Fabricante"}
                  type={"text"}
                />
                <FormFields
                  name={"Modelo"}
                  placeholder={"Modelo"}
                  type={"text"}
                />
                <FormFields name={"Ano"} placeholder={"Ano"} type={"number"} />
              </div>
              <div className={Style.form}>
                <div className={Style.form__media}>
                  <FormFields
                    name={"Câmbio"}
                    placeholder={"Câmbio"}
                    type={"text"}
                  />
                  <ColFields
                    type={"text"}
                    name={"Potência"}
                    placeholder={"Potência"}
                    Style={Style}
                    unidadeMedida={"CV"}
                  />
                </div>
                <div className={Style.form__media}>
                  <ColFields
                    type={"text"}
                    name={"Torque"}
                    placeholder={"Torque"}
                    Style={Style}
                    unidadeMedida={"N.m"}
                  />
                  <FormFields name={"KM"} type={"number"} placeholder={"KM"} />
                </div>
              </div>
              <div className={Style.form}>
                <FormFields name={"Cor"} placeholder={"Cor"} type={"text"} />
                <FormFields
                  name={"Cabine"}
                  placeholder={"Cabine"}
                  type={"text"}
                />
                <FormFields
                  type={"text"}
                  name={"RelacaoDiferencial"}
                  placeholder={"Relação diferencial"}
                />
                <FormFields
                  name={"Suspensão"}
                  type={"text"}
                  placeholder={"Suspensão"}
                />
              </div>
              <div className={Style.form}>
                <div className={Style.form__media}>
                  <FormFields
                    name={"EntreEixos"}
                    placeholder={"Entre-eixos"}
                    type={"number"}
                  />
                  <FormFields
                    name={"Placa"}
                    placeholder={"Placa do veículo"}
                    type={"text"}
                  />
                  <ColFields
                    type={"number"}
                    name={"CapMaxCombustível"}
                    placeholder={"Cap. máx. combustível"}
                    Style={Style}
                    unidadeMedida={"L"}
                  />
                </div>
                <ColFields
                  type={"number"}
                  name={"Preço"}
                  placeholder={"Valor"}
                  Style={Style}
                  unidadeMedida={"R$"}
                />
              </div>
              <div className={Style.form__media__textarea}>
                <TextArea
                  name={"InfoAd"}
                  placeholder={"Informações opcionais"}
                  label={"Informações opcionais"}
                  Style={Style}
                />
                <TextArea
                  name={"InfoOp"}
                  placeholder={"Informações adicionais"}
                  label={"Informações adicionais"}
                  Style={Style}
                />
              </div>

              <div className={Style.buttons__field}>
                <ImageSelector label={"Selecionar múltiplas imagens"} />
                <Buttons
                  type={"reset"}
                  variant={"outline-danger"}
                  name={"Limpar"}
                />{" "}
                <Buttons
                  type={"submit"}
                  variant={"outline-success"}
                  name={"Cadastrar"}
                />
              </div>
            </form>
          </label>
        </div>
      </div>
    </>
  );
}
